import React from 'react';
import './index.css';  // This will reference the same CSS file for styling

function App() {
  return (
    <div className="App">
      {/* Logo */}
      <img src="logo.png" alt="Logo" className="logo" />

      {/* Header Section */}
      <header>
        <h1>Welcome to Fuel Quote Master</h1>

        {/* Navigation */}
        <nav>
          <ul>
            <li><a href="login.html">Login</a></li>
            <li><a href="registration.html">Register</a></li>
            <li><a href="FuelQuoteForm.html">Quote</a></li>
            <li><a href="ClientProfileManagement.html">New Client</a></li>
          </ul>
        </nav>
      </header>

      {/* Main Section */}
      <p>
        <strong>
          "Your premier destination for instant fuel price comparisons. <br />
          Say goodbye to uncertainty and hello to transparency with our user-friendly platform. <br />
          Start saving time and money today with Fuel Quote Master."
        </strong>
      </p>
    </div>
  );
}

export default App;
